import React from 'react';
import './App.css';
import { ScrollTo } from "react-scroll-to";


export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.myRef = React.createRef();
  }

  render() {
    return (
      <div className="App" onKeyPress={() => scrollTo({id: "2", y: 500})}>
        <div className="App-header">

        </div>
        <div id="2" ref={this.myRef} className="App-header2">
          <p>Hello</p>
        </div>
      </div>
    );
  }
}
